# Parse and import
fixtures_data = json.loads(fixtures_json)

# Connect to local MongoDB
client = MongoClient(os.getenv('MONGO_URL', 'mongodb://localhost:27017'))
db = client['test_database']

print(f"Importing {len(fixtures_data)} fixtures from production...")

imported = 0
updated = 0

for fixture in fixtures_data:
    # Convert date string to datetime
    if 'utc_date' in fixture and isinstance(fixture['utc_date'], str):
        fixture['utc_date'] = datetime.fromisoformat(fixture['utc_date'])
    
    # Remove MongoDB _id to let it generate new ones
    if '_id' in fixture:
        del fixture['_id']
    
    # Upsert based on fixture_id
    result = db.fixtures.update_one(
        {'fixture_id': fixture['fixture_id']},
        {'$set': fixture},
        upsert=True
    )
    
    if result.upserted_id:
        imported += 1
    elif result.modified_count > 0:
        updated += 1

print(f"\n✅ Import complete!")
print(f"   New fixtures: {imported}")
print(f"   Updated fixtures: {updated}")
print(f"   Total fixtures in database: {db.fixtures.count_documents({})}")

client.close()
